import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { fetchHistoricalData } from '../store/complianceSlice';
import { Line } from 'react-chartjs-2';
import { Chart, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';

// Register Chart.js components
Chart.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const HistoryPage = () => {
  const dispatch = useDispatch();
  const { historicalData, categoryScores, loading } = useSelector(state => state.compliance);
  const [timeRange, setTimeRange] = useState('30days');
  const [selectedCategories, setSelectedCategories] = useState([]);

  // Load historical data when the component mounts or timeRange changes
  useEffect(() => {
    dispatch(fetchHistoricalData({ timeRange }));
  }, [dispatch, timeRange]);

  // Get available categories
  const categories = Object.keys(categoryScores);

  // Toggle category selection
  const toggleCategory = (category) => {
    if (selectedCategories.includes(category)) {
      setSelectedCategories(selectedCategories.filter(c => c !== category));
    } else {
      setSelectedCategories([...selectedCategories, category]);
    }
  };

  // Prepare data for line chart
  const prepareChartData = () => {
    if (!historicalData || historicalData.length === 0) {
      return {
        labels: [],
        datasets: []
      };
    }

    // Sort data by timestamp
    const sortedData = [...historicalData].sort((a, b) => 
      new Date(a.timestamp) - new Date(b.timestamp)
    );

    // Extract dates for x-axis
    const labels = sortedData.map(data => {
      const date = new Date(data.timestamp);
      return date.toLocaleDateString();
    });

    // Create overall compliance score dataset
    const datasets = [
      {
        label: 'Overall Compliance',
        data: sortedData.map(data => data.complianceScore),
        borderColor: 'rgb(59, 130, 246)',
        backgroundColor: 'rgba(59, 130, 246, 0.5)',
        borderWidth: 2,
        tension: 0.3,
      }
    ];

    // Add selected category datasets
    if (selectedCategories.length > 0) {
      // Color palette for categories
      const colors = [
        { border: 'rgb(16, 185, 129)', bg: 'rgba(16, 185, 129, 0.5)' }, // Green
        { border: 'rgb(245, 158, 11)', bg: 'rgba(245, 158, 11, 0.5)' }, // Orange
        { border: 'rgb(236, 72, 153)', bg: 'rgba(236, 72, 153, 0.5)' }, // Pink
        { border: 'rgb(139, 92, 246)', bg: 'rgba(139, 92, 246, 0.5)' }, // Purple
        { border: 'rgb(239, 68, 68)', bg: 'rgba(239, 68, 68, 0.5)' },  // Red
      ];

      selectedCategories.forEach((category, index) => {
        const colorIndex = index % colors.length;

        datasets.push({
          label: category,
          data: sortedData.map(data => {
            // Find the category score in each historical record
            return data.categoryScores?.[category]?.score || null;
          }),
          borderColor: colors[colorIndex].border,
          backgroundColor: colors[colorIndex].bg,
          borderWidth: 2,
          tension: 0.3,
        });
      });
    }

    return { labels, datasets };
  };

  const chartData = prepareChartData();

  // Format timestamp
  const formatTimestamp = (timestamp) => {
    const date = new Date(timestamp);
    return `${date.toLocaleDateString()} ${date.toLocaleTimeString()}`;
  };

  return (
    <div>
      <h1 className="text-2xl font-bold text-gray-800 mb-6">Compliance History</h1>

      {/* Controls and Filters */}
      <div className="bg-white p-4 rounded-lg shadow-md mb-6">
        <div className="flex flex-wrap gap-4 items-end">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Time Range</label>
            <select
              value={timeRange}
              onChange={e => setTimeRange(e.target.value)}
              className="px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option value="7days">Last 7 Days</option>
              <option value="30days">Last 30 Days</option>
              <option value="90days">Last 90 Days</option>
              <option value="1year">Last Year</option>
            </select>
          </div>

          <div className="ml-auto">
            <button
              onClick={() => dispatch(fetchHistoricalData({ timeRange }))}
              disabled={loading}
              className="bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded-md flex items-center"
            >
              {loading ? 'Loading...' : 'Refresh'}
              {loading && <span className="ml-2 animate-spin">⟳</span>}
            </button>
          </div>
        </div>
      </div>

      {/* Chart */}
      <div className="bg-white p-4 rounded-lg shadow-md mb-6">
        <h2 className="text-xl font-semibold mb-4">Compliance Trend</h2>
        <div className="h-80 mb-6">
          <Line 
            data={chartData} 
            options={{
              responsive: true,
              maintainAspectRatio: false,
              scales: {
                y: {
                  beginAtZero: true,
                  max: 100,
                  ticks: {
                    callback: function(value) {
                      return value + '%';
                    }
                  }
                }
              },
              plugins: {
                legend: {
                  position: 'bottom',
                },
                tooltip: {
                  callbacks: {
                    label: function(context) {
                      return context.dataset.label + ': ' + context.parsed.y + '%';
                    }
                  }
                }
              }
            }}
          />
        </div>

        {/* Category Selection */}
        <div>
          <h3 className="text-md font-medium mb-2">Show Categories:</h3>
          <div className="flex flex-wrap gap-2">
            {categories.map(category => (
              <button
                key={category}
                onClick={() => toggleCategory(category)}
                className={`py-1 px-3 rounded-full text-sm ${
                  selectedCategories.includes(category)
                    ? 'bg-blue-100 text-blue-800 border border-blue-300'
                    : 'bg-gray-100 text-gray-800 border border-gray-200'
                }`}
              >
                {category}
              </button>
            ))}
          </div>
        </div>
      </div>

      {/* History Table */}
      <div className="bg-white rounded-lg shadow-md overflow-hidden">
        <h2 className="text-xl font-semibold p-4 border-b">Scan History</h2>
        <div className="overflow-x-auto">
          <table className="controls-table">
            <thead>
              <tr>
                <th>Timestamp</th>
                <th>Overall Score</th>
                <th>Passing Controls</th>
                <th>Failing Controls</th>
                <th>Errors</th>
                <th>Report</th>
              </tr>
            </thead>
            <tbody>
              {historicalData.map((record, index) => (
                <tr key={index}>
                  <td>{formatTimestamp(record.timestamp)}</td>
                  <td className="font-medium">{record.complianceScore}%</td>
                  <td className="text-green-600">{record.statusCounts?.PASS || 0}</td>
                  <td className="text-red-600">{record.statusCounts?.FAIL || 0}</td>
                  <td className="text-yellow-600">{record.statusCounts?.ERROR || 0}</td>
                  <td>
                    {record.reportUrl && (
                      <a 
                        href={record.reportUrl} 
                        target="_blank" 
                        rel="noopener noreferrer"
                        className="text-blue-600 hover:text-blue-800 hover:underline"
                      >
                        View Report
                      </a>
                    )}
                  </td>
                </tr>
              ))}

              {historicalData.length === 0 && (
                <tr>
                  <td colSpan="6" className="text-center py-8 text-gray-500">
                    {loading ? 'Loading historical data...' : 'No historical data available.'}
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default HistoryPage;
